import React, { Component } from 'react';
import Banner from '../components/Banner';
import BgBanner from '../components/BgBanner';
import {Link} from 'react-router-dom';
import {RoomConsumer} from '../Context';
import Property from '../components/Property';
import Loading from '../components/Loading';
export default class PropList extends Component {
    static contextType = RoomConsumer
    render() {
        const {loading, rooms:propertyList} = this.context;
        const properties = propertyList.map(singleProp => {
            return <Property key={singleProp.id} singleProp={singleProp}/>
        })
        return ( 
        <div>
            <Banner banner = "roomsBanner">
                <BgBanner title = "Our Properties">
                    <Link to='/' className="btn-primary">Return Home</Link>
                </BgBanner>
            </Banner>
            <br/>
            <div className="featured-rooms-center">
                {loading?<Loading/> : properties}
            </div>
        </div>
        )
    }
}
